%sql
--make sure you've run ZeppelinTutorial First!


select ${groupBy}, 
${balFunc}(${metric}) as ${metric},
count(job) as job,
count(marital) as marital,
count(education) as education
from bank 
${filterString}
group by ${groupBy}
order by ${metric} ${sort}

